import React from "react";
import ReactDOM from "react-dom";
import { HashRouter, Route, Link } from "react-router-dom";
import "./index.css";
import SorterApp from "./sorter/SorterApp";

class App extends Component {
  render() {
    return (
      <HashRouter basename="/">
        <div>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/sorter">Sorter</Link>
            </li>
            <li>
              <Link to="/pathfinder">Pathfinder</Link>
            </li>
          </ul>

          <hr />

          <Route exact path="/" component={Home} />
          <Route path="/sorter" component={Sorter} />
          <Route path="/pathfinder" component={Pathfinder} />
        </div>
      </HashRouter>
    );
  }
}

const Home = () => (
  <div>
    <h2>Home</h2>
  </div>
);
const Sorter = () => <SorterApp />;
const Pathfinder = () => (
  <div>
    <h2>Pathfinder</h2>
  </div>
);

export default App;

ReactDOM.render(
  <React.StrictMode>
    <SorterApp />
  </React.StrictMode>,
  document.getElementById("root")
);
